script: |
  super -f text -I q7926.spq | sort > q7926.out

inputs:
  - name: q7926.spq
    data: |
      SELECT - + 29 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT col2 * + 14 + - - 13 > - - col1 + - col0 * + + col2 + col1 * + + col0 * - col2 * - col1;
  - name: tab0

outputs:
  - name: q7926.out
    data: |
      -29
      -29
